import axios from 'axios';
import React, { Component } from 'react';

export default class Register extends Component {
    handleSubmit = () =>{
        e.prevenetDefault();
        const data = {
            first_name: this.firstName,
            last_name: this.lastName,
            email: this.email,
            password: this.password,
            password_confirm: this.confirmPassword
        };
        axios.post('http://localhost:3001/register',data).thin(
            res=>{
                console.log(res)
            }
        ).catch(
            err =>{
                consol
            }
        )
    };

    render() {
         return (
        <form onSubmit={this.handleSubmit}>

            <h3>S'inscrire</h3>
            <div className="form-group">
                <label>Nom</label>
                <input type="text" className="form-control" placeholder="Nom"
                onChange={e => this.lastName = e.target.value}/>
            </div>

            <div className="form-group">
                <label>Prénom</label>
                <input type="text" className="form-control" placeholder="Prénom"
                onChange={e => this.firstName = e.target.value}/>
            </div>

            <div className="form-group">
                <label>E-mail</label>
                <input type="email" className="form-control" placeholder="E-mail"
                onChange={e => this.email = e.target.value} />
            </div>

            <div className="form-group">
                <label>Mot de passe</label>
                <input type="Mot de passe" className="form-control" placeholder="Mot de passe"
                onChange={e => this.password = e.target.value}/>
            </div>

            <div className="form-group">
                <label>Confirmez mot de passe</label>
                <input type="Mot de passe" className="form-control" placeholder="Confirmez mot de passe"
                onChange={e => this.confirmPassword = e.target.value}/>
            </div>

            <button className="btn btn-primary btn-blok">Valider</button>
        </form>  
        ) 
    }


}
